import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";


// {
//   id: 1,
//   emoji: "üí™",
//   name: "Tense Biceps",
//   meaning:
//     "You can do that!‚Äù or ‚ÄúI feel strong!‚Äù Arm with tense biceps. Also used in connection with doing sports, e.g. at the gym."
// }
function createEntry(emojiTerm) {
  return (
    <Entry
      key={emojiTerm.id}
      emoji={emojiTerm.emoji}
      name={emojiTerm.name}
      description={emojiTerm.meaning}
    />
  );
}


function App() {
  return (
    <div>
      <h1>
        <span>
          emojipedia
        </span>
      </h1>
      <dl className="dictionary">
        {emojipedia.map()}
      </dl>
    </div>
  );
}

export default App;
